void openBase64PdfInNewTab(
  {
    String base64Str=""}) {
  if (kIsWeb) {
    // Decode base64 string
    Uint8List bytes = base64Decode(base64Str);

    // Create a Blob
    final blob = html.Blob([bytes], 'application/pdf');

    // Create an object URL
    final url = html.Url.createObjectUrlFromBlob(blob);

    // Open in new browser tab
    html.window.open(url, '_blank');

    // Optional: Revoke URL later
    // html.Url.revokeObjectUrl(url);
  } else {
    print("This works only on Flutter Web.");
  }
}

  @override
  Widget build(BuildContext context){
    return Scaffold(body:Center(
      child:  Column(children: [Text("Working on it "),SizedBox(height: 25,),
      ElevatedButton(onPressed: openBase64PdfInNewTab, child: Text("Resume"))],),
    ));
  }
}